import React, { Component } from "react";
import plant from "../../Assets/plant.png";
import Pnav from "../Projects";

export default class Strange extends Component {
  render() {
    return (
      <div>
        <Pnav />
        <h1 type="text" id="title" name="title">
          {this.state.title}
        </h1>
        <img
          className="Grimbild"
          src={require("../../Assets/plant.png")}
          alt=""
        />
        <iframe
          src="https://player.vimeo.com/video/364942210?autoplay=1&title=0&byline=0&portrait=0"
          width="640"
          height="360"
          frameborder="0"
          allow="autoplay; fullscreen"
          allowfullscreen
        ></iframe>
      </div>
    );
  }
}
